import React from 'react';
import "./styles/Profile.css";

const profile = (props) => {
    return(
    <div className="profile"> 
        <section className="profileSection">
            <ul>
                <li>Ihre User ID: <div className="pDiv">{props.user.id}</div></li>
                <li>Ihr Username: <div className="pDiv">{props.user.username}</div></li>
                <li><div className="pDiv">{props.user.name}</div></li>
                <li><div className="pDiv">{props.user.firstName}</div></li>
                <li><div className="pDiv">{props.user.email}</div></li>
                <li><div className="pDiv">{props.user.signUpDate}</div></li>
            </ul>
        </section>
    </div>
    );
}

export default profile;
